import React from 'react';
import Pitle from './Pitle.js';
import Hdr from './Hdr.js.js';
import Prs from './Prs.js'

function App (){
    return(
        <div className='container'>
            <Pitle />
            <Hdr/>
            <Prs />
        </div>
        
    );
}

export default App;
